import React from 'react'

export default function Homepagecomp() {
  return (
    <div className='home'>
        <iframe src="https://youtu.be/nqAxRJhUT3k?si=lPAUCC7Ts7u2zst8" 
        title="Mei and Satsuki wait for Dad to come home on the bus, but they run into Totoro instead! And my, what a furry bus!"
         className='landingvideo'></iframe>
      
    </div>
  )
}
